function drawPie3dExploded() {
    var e = google.visualization.arrayToDataTable([
        ["Category", "Contribution"],
        ["Bank Sampah Unit", 1927],
        ["Bisnis", 1232],
        ["Hotel", 1223],
        ["Sekolah", 500],
        ["Jasa Sampah", 4332],
        ["Pengepul", 26723],
        ["TPS3R", 322],
        ["TPST3R", 112],
        ["TPA", 542],
    ]);
    new google.visualization.PieChart(document.getElementById("pie-3d-exploded")).draw(e, {
        title: "My Daily Activities",
        is3D: !0,
        
        height: 400,
        fontSize: 12,
        colors: ["#99B898", "#FECEA8", "#FF847C", "#E84A5F", "#474747"],
        chartArea: { left: "5%", width: "90%", height: 350 },
        slices: { 1: { offset: 0.2 }, 2: { offset: 0.15 }, 3: { offset: 0.16 }, 4: { offset: 0.12 } },
    });
}
google.load("visualization", "1.0", { packages: ["corechart"] }),
    google.setOnLoadCallback(drawPie3dExploded),
    $(function () {
        function e() {
            drawPie3dExploded();
        }
        $(window).on("resize", e), $(".menu-toggle").on("click", e);
    });
